    "2016-01-28T13:16:44.292970",nt"name": "zoning-7eee0",nt"isopen": false,nt"url":
    null,nt"notes": "Zoning is a tool used by the City of Los Angeles to designate,
    regulate and restrict the location and use of buildings, structures and land, for
    agriculture, residence, commerce, trade, industry or other purposes; to regulate
    and limit the height, number of stories, and size of buildings and other structures
    hereafter erected or altered to regulate and determine the size of yards and other
    open spaces and to regulate and limit the density of population; and for said purposes
    to divide the City into zones of such number, shape and area as may be deemed best
    suited to carry out these regulations and provide for their enforcement. Further,
    such regulations are deemed necessary in order to encourage the most appropriate
    use of land; to conserve and stabilize the value of property; to provide adequate
    open spaces for light and air, and to prevent and fight fires; to prevent undue
    concentration of population; to lessen congestion on streets; to facilitate adequate
    provisions for community utilities and facilities such as transportation, water,
    sewerage, schools, parks and other public requirements; and to promote health, safety,
    and the general welfare all in accordance with the comprehensive plan.",nt"license_title":
